var socket;
var STYLESHEETS = ["global.css", "minecraftColors.css", "smartMenu.css", "other-license/bulma.min.css", "other-license/bulma-extensions.min.css", "other-license/hightlightjs.railcasts.min.css", "other-license/materialIcons.css", "other-license/vanillatoasts.css"];
var SCRIPTS = ["other-license/sweetalert2.min.js", "global.js", "taskManager.js", "componentGenerator.js", "smartMenu.js", "minecraftColors.js", "other-license/apexcharts.js", "other-license/bulma-extensions.min.js", "other-license/highlight.min.js", "other-license/jsencrypt.min.js", "other-license/vanillatoasts.js", "socketRessourceManager.js", "notificationManager.js", "dynamicDataManager.js"]
var MAX_SOCKET_TRIES = 15;
var theme;

var WIFI_ICON = "data:image/png;base64,";
var CROSS_ICON = "data:image/png;base64,";
var WIFI_FAIL_ICON = "data:image/png;base64,";
var LOCK_ICON = "data:image/png;base64,";
var STYLE_ICON = "data:image/png;base64,";
var SCRIPT_ICON = "data:image/png;base64,";
var BASE_ICON = "data:image/png;base64,";

function getDOMs() {
    var loaderTitleDOM = document.querySelector('.ctitle');
    var loaderMessageDOM = document.querySelector('.csubtitle');
    var loaderIconDOM = document.querySelector('.stepIcon');
    var loaderProgressDOM = document.querySelector(".progress");
    var formIn = document.querySelector(".formIn");
    var input = document.querySelector("input");
    var inputInfLable = document.querySelector(".inputInfoLable");
    return [loaderTitleDOM, loaderMessageDOM, loaderIconDOM, loaderProgressDOM, formIn, input, inputInfLable];
}

async function init() {
    var DOMs = getDOMs();

    DOMs[0].innerHTML = "%T%CONNECTION%T%";
    DOMs[1].innerHTML = "%T%TRYING_TO_CONNECT_TO_SERVER%T%";
    DOMs[2].src = WIFI_ICON;
    socket = io();

    var SOCKET_TRIES = 0;
    while (!socket.connected) {
        DOMs[1].innerHTML = "%T%TRYING_TO_CONNECT_TO_SERVER%T%";
        SOCKET_TRIES++;
        await timer(1000);

        if (SOCKET_TRIES >= MAX_SOCKET_TRIES) {
            DOMs[2].src = WIFI_FAIL_ICON;
            DOMs[1].innerHTML = "Failed to establish connection";
            DOMs[1].classList.add("has-text-danger");
            DOMs[3].value = 100;
            DOMs[3].classList.add("is-danger");
            return;
        }
    }
    DOMs[3].value = 5;

    await requireAuth();

    DOMs[3].value = 10;

    DOMs = getDOMs();

    socket.on("disconnect", async function() {
        Swal.fire({
            title: "%T%RECONNECTING%T%",
            html: "%T%WEBSOCKET_LOST_CONNECTION%T%<br><br>%T%RELOAD_PAGE_IF_NEC%T%",
            icon: "error",
            showConfirmButton: false,
            allowOutsideClick: false,
            allowEscapeKey: false
        });
        Swal.showLoading();

        while (!socket.connected) {
            await timer(1000);
        }

        Swal.fire({
            title: "%T%RECONNECTED%T%",
            icon: "success",
            html: "%T%WEBSOCKET_RECONNECTED%T%<br><br>%T%RELOAD_PAGE_IF_NEC%T%",
            timer: 5000
        });
    });

    DOMs[0].innerHTML = "%T%STYLING%T%";
    DOMs[2].src = STYLE_ICON;
    theme = await socketIoRequestAwait({ TYPE: "DATA", METHOD: "THEME" });

    if (theme == "dark") {
        STYLESHEETS.push("other-license/bulmaswatch.min.css");
        STYLESHEETS.push("other-license/sweet_dark.css");
        STYLESHEETS.push("dark.css");
    }

    for (elem of STYLESHEETS) {
        DOMs[1].innerHTML = "%T%INIT_LOADING_STYLE%T%".replace("%NAME%", elem);
        var css = await socketIoRequestAwait({ TYPE: "WEBFILE", PATH: "global/" + elem }),
            head = document.head || document.getElementsByTagName('head')[0],
            style = document.createElement('style');
        head.appendChild(style);
        style.type = 'text/css';
        if (style.styleSheet) { style.styleSheet.cssText = css; } else { style.appendChild(document.createTextNode(css)); }

        DOMs[3].value += 30 / STYLESHEETS.length;
        await timer(25);
    }

    DOMs[0].innerHTML = "%T%SCRIPTS%T%";
    DOMs[2].src = SCRIPT_ICON;
    for (elem of SCRIPTS) {
        DOMs[1].innerHTML = "%T%INIT_LOADING_SCRIPT%T%".replace("%NAME%", elem);
        var js = await socketIoRequestAwait({ TYPE: "WEBFILE", PATH: "global/" + elem }),
            head = document.head || document.getElementsByTagName('head')[0];

        appendScript(js, head);

        DOMs[3].value += 50 / SCRIPTS.length;
        await timer(25);
    }

    addNewTask("HEIGHTFILL", heightFillRestClass, 500);
    addNewTask("NOTIFICATIONS", refreshNotifications, 1000 * 2);
    addNewTask("DYNDATA", dynamicDataManager.dynamicDataTask, 1000);

    DOMs[0].innerHTML = "%T%BASEPAGE%T%";
    DOMs[1].innerHTML = "%T%LOADING_BASEPAGE%T%";
    DOMs[2].src = BASE_ICON;
    var BASEPAGE_HTML = await socketIoRequestAwait({ TYPE: "WEBFILE", PATH: "BASEPAGE.html" });
    DOMs[3].value += 10 / 3;
    var BASEPAGE_JS = await socketIoRequestAwait({ TYPE: "WEBFILE", PATH: "BASEPAGE.js" });
    DOMs[3].value += 10 / 3;
    document.querySelector(".BASEPAGE").innerHTML = BASEPAGE_HTML;
    appendScript(BASEPAGE_JS, document.querySelector(".BASEPAGE"));
    DOMs[3].value += 10 / 3;

    await timer(100);
    document.querySelector(".initLoader").remove();
}

async function requireAuth() {
    var DOMs = getDOMs();
    DOMs[0].innerHTML = "%T%AUTHENTICATION%T%";
    DOMs[1].innerHTML = "%T%REQUIRE_AUTH%T%";
    DOMs[2].src = LOCK_ICON;
    DOMs[4].classList.remove("hidden");

    while ((await socketIoRequestAwait({ METHOD: "STATE" }, "AUTH") == false)) {
        await timer(1000);
    }

    var valBefore = DOMs[3].value;
    DOMs[3].removeAttribute("value");
    DOMs[4].classList.add("hidden");
    DOMs[0].innerHTML = "%T%PAGE%T%";
    DOMs[1].innerHTML = "%T%LOADING_PAGE%T%";

    await timer(100);
    DOMs[3].value = valBefore;
}

async function tryAuth() {
    var DOMs = getDOMs();
    var USERNAME = "ADMIN";
    var PASSWORD = DOMs[5].value;

    var valBefore = DOMs[3].value;
    DOMs[3].removeAttribute("value");
    var res = await socketIoRequestAwaitFull({ METHOD: "AUTHENTICATE", USERNAME: USERNAME, PASSWORD: PASSWORD }, "AUTH");
    DOMs[3].value = valBefore;

    if (res.CODE != 200) {
        DOMs[3].classList.add("is-danger");
        DOMs[6].classList.add("has-text-danger");
        DOMs[6].innerHTML = res.DATA.replace("ERR_WRONG_NAME_OR_PASSWORD", "%T%WRONG_NAME_OR_PASSWORD%T%");
    } else {
        DOMs[3].classList.remove("is-danger");
        DOMs[6].classList.remove("has-text-danger");
        DOMs[6].classList.add("has-text-success");
        DOMs[6].innerHTML = "%T%LOGIN_SUCCESS%T%";
    }


}

async function socketIoRequestAwait(data, INTERNAL_METHOD = "REQUEST") {
    return (await socketIoRequestAwaitFull(data, INTERNAL_METHOD)).DATA;
}

function socketIoRequestAwaitFull(data, INTERNAL_METHOD = "REQUEST") {
    data = JSON.stringify(data);
    //console.log(INTERNAL_METHOD + " --> " + data);
    return new Promise((resolve, reject) => {
        socket.emit(INTERNAL_METHOD, data, function(respdata) {
            var parsedResp = JSON.parse(respdata);
            resolve(parsedResp);
        });
    });
}

function appendScript(js, dom) {
    var script = document.createElement('script');
    script.innerHTML = js;
    script.type = "text/javascript";
    return dom.appendChild(script);
}

const timer = function(time) {
    return new Promise((resolve, reject) => {
        setTimeout(resolve, time);
    });
}

init();

